  "geo" : { },
  "id_str" : "421262211772723200",
  "in_reply_to_user_id" : 2234512746,
  "text" : "Music allows me to feel a closer connection to other lands and people. It is a cultural window.",
  "id" : 421262211772723200,
  "in_reply_to_status_id" : 421261607004413952,
  "created_at" : "2014-01-09 12:48:32 +0000",
