  "geo" : { },
  "id_str" : "420826793705082880",
  "in_reply_to_user_id" : 2234512746,
  "text" : "Peter Gabriel was their theatrical, flamboyant frontman, and their stage shows were legendary. Gabriel would change costume a dozen times!",
